(window.webpackJsonp=window.webpackJsonp||[]).push([[909],{1265:function(n,h,t){"use strict";t.r(h);var g=t(44),i=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1792-di-linh-vuong-thanh-【-canh-4-】"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1792-di-linh-vuong-thanh-【-canh-4-】"}},[n._v("#")]),n._v(" Chương 1792: Dị Linh vương thành 【 Canh [4] 】")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1792: Dị Linh vương thành "),t("br"),t("br"),n._v("Nghe được thanh âm này, đầu này Dị Linh tộc nhân thân thể cứng đờ, thân thể kìm lòng không được run rẩy một cái, vội vàng ngẩng đầu."),t("br"),t("br"),n._v("“Ngươi là... Lão sư?”"),t("br"),t("br"),n._v("Thanh âm này, quá quen thuộc, ngày đêm đều ở trong mơ xuất hiện, nghe xong liền biết là ai!"),t("br"),t("br"),n._v("“Đúng ta, ngươi làm sao biến thành Dị Linh tộc nhân? Lại đến nơi này?”"),t("br"),t("br"),n._v("Trương Huyền tràn đầy nghi ngờ."),t("br"),t("br"),n._v("Trước mắt vị này Dị Linh tộc nhân, ngụy trang tuy là rất tốt, trong cơ thể sát lục chi khí thoạt nhìn cũng rất chính thống nồng đậm, trên thực tế, không ẩn giấu được hắn Minh Lý Chi Nhãn, liếc thấy đi ra, chính là cái kia tại Thanh Nguyên đế quốc, không từ mà biệt học sinh, Lưu Dương!"),t("br"),t("br"),n._v("Bởi vì những học sinh khác quá mức ưu tú, hắn không chịu nổi áp lực, không từ mà biệt, bản thân từng để Triệu Nhã, Trịnh Dương đám người phái Băng Nguyên cung, Chiến Sư đường thậm chí Danh Sư đường người, đi tìm, đều không có bất cứ tin tức gì."),t("br"),t("br"),n._v("Nằm mơ đều không có nghĩ đến, lại bị Ngột Thần thu làm học sinh, mang theo Dị Linh tộc!"),t("br"),t("br"),n._v("“Chuyện này quay đầu lại cùng lão sư đàm phán... Thần Dung Hoàng cũng không biết thân phận chân thật của ta... Mong rằng lão sư thay mặt giữ bí mật!” Lưu Dương truyền âm."),t("br"),t("br"),n._v("“Ừm!” Trương Huyền gật đầu."),t("br"),t("br"),n._v("Cảnh tượng trước mắt, hắn cũng có thể nhìn ra, vì lẽ đó vừa rồi chỉ là truyền âm, cũng không mở miệng."),t("br"),t("br"),n._v("“Các ngươi quen biết?”"),t("br"),t("br"),n._v("Hai người truyền âm tốc độ rất nhanh, vẫn như cũ bị Ngột Thần phát hiện một ít đầu mối, lộ ra nghi ngờ."),t("br"),t("br"),n._v("“Không có, chẳng qua là cảm thấy ngươi người học sinh này, thiên phú dị bẩm, vì lẽ đó lặng lẽ hỏi thăm một ít, trong vấn đề tu luyện...” Trương Huyền nhẹ nhàng cười một tiếng."),t("br"),t("br"),n._v("“Trong vấn đề tu luyện?” Ngột Thần sửng sốt một chút, gặp hắn không nguyện ý nói nhiều, cũng không hỏi tới nữa, nhịn không được hỏi: “Hiện tại nội thành tình huống thế nào?”"),t("br"),t("br"),n._v("Hiện tại quan tâm nhất chính là cái này."),t("br"),t("br"),n._v("đọc ngantruyen.com"),t("br"),n._v("“Linh Hoàng cùng Tinh Hoàng một tháng trước trở lại nội thành, đối ngoại tuyên bố, ngươi đã bị nhân tộc chém giết, bọn họ cũng bị thương, hiện tại... Bệ hạ quân đội, bị hắn nắm chắc, trong đó rất cường đại quan tướng, đều bị thay đổi xong xuôi, coi như trở về, chỉ sợ cũng không cách nào điều động, nghe theo mệnh lệnh!”"),t("br"),t("br"),n._v("Lưu Dương nói."),t("br"),t("br"),n._v("Không nghĩ tới hai vị này Hoàng giả, quả nhiên cùng đoán đồng dạng, đem hắn đường lui toàn bộ chặt đứt, Ngột Thần sắc mặt tái xanh."),t("br"),t("br"),n._v("“Những cái kia bị thay đổi quan tướng, người ở nơi nào?”"),t("br"),t("br"),n._v("Những người này đều là trung thành với hắn cường giả, nếu như có thể tìm tới, có lẽ còn có đảo ngược cơ hội."),t("br"),t("br"),n._v("“Bọn họ bị dời quân đội về sau, trong một tháng, đều bị độc thủ, tất cả đều... Không còn nữa!”"),t("br"),t("br"),n._v("Lưu Dương nói."),t("br"),t("br"),n._v("“Bị độc thủ?” Ngột Thần thân thể vụt qua."),t("br"),t("br"),n._v("Sớm biết cái này Linh Hoàng tàn nhẫn, không nghĩ tới ác như vậy!"),t("br"),t("br"),n._v("Thật đúng là nhổ cỏ tận gốc, một cơ hội nhỏ nhoi cũng không lưu lại cho mình."),t("br"),t("br"),n._v("“Hai người bọn họ hiện tại tình trạng cơ thể như thế nào?” Bình phục ngực lửa giận, Ngột Thần tiếp tục hỏi."),t("br"),t("br"),n._v("Hai người này gặp phải bản thân đánh lén, tất cả đều bị trọng thương, tuy là không có mình nghiêm trọng như vậy, khẳng định cũng tổn thương cơ sở, không dễ dàng như vậy khôi phục."),t("br"),t("br"),n._v("Chỉ cần còn có thương, liền có cơ hội."),t("br"),t("br"),n._v("Nói trắng ra là, đạt tới bọn họ loại cảnh giới này, thực lực bản thân mới là mấu chốt nhất, cái gọi là quân đội, chính quyền, tất cả đều không tính là gì."),t("br"),t("br"),n._v("Chỉ cần có thể đem hai cái này phản đồ đánh giết, sau đó tuyên bố bản thân quay về, những thuộc hạ kia, còn không một lần nữa ngoan ngoãn nghe theo mệnh lệnh?"),t("br"),t("br"),n._v("“Tình huống cụ thể, hỏi thăm không ra, thân thể của bọn hắn tình huống, hiện tại là cơ mật tối cao...” Lưu Dương lắc đầu."),t("br"),t("br"),n._v("Ngột Thần cũng không kỳ lạ, nếu như loại này cơ mật, dễ như trở bàn tay bị biết, hai người này cũng không có khả năng thiết kế để cho mình chật vật như thế, suýt chút nữa mất mạng tha hương."),t("br"),t("br"),n._v("Tiếp tục xem tới, nói: “Bọn họ lôi kéo Cổ Thánh có chừng bao nhiêu, ngươi đây hẳn là biết đi!”"),t("br"),t("br"),n._v("Thần Linh Hoàng, Thần Tinh Hoàng làm ra phục sát chuyện của mình, vì phòng ngừa bản thân không có chết, tất nhiên sẽ lôi kéo một nhóm lớn Cổ Thánh."),t("br"),n._v("Đây mới là căn bản nhất lực lượng."),t("br"),t("br"),n._v("“Theo ta tìm hiểu tin tức, Tắc Vương, Hòe Vương, Manh Vương tám vị vương gia bị mời chào, triệt để đưa về bọn họ trận doanh, nghe theo chỉ huy...”"),t("br"),t("br"),n._v("Lưu Dương nói tiếp."),t("br"),t("br"),n._v("“Tắc Vương, Hòe Vương, Manh Vương? Hừ!” Ngột Thần hơi vung tay cánh tay."),t("br"),t("br"),n._v("Dị Linh tộc ba đại Hoàng giả dưới trướng, có mười bốn vị đỉnh phong vương giả, Tắc Vương, Hòe Vương những này, chính là trong đó cường đại nhất, mỗi một cái đều đạt đến Cổ Thánh cấp bậc, mạnh thậm chí đạt đến tam trọng tích huyết trùng sinh!"),t("br"),t("br"),n._v("Bởi vì là phiên vương, bình thường mệnh lệnh bất động, không nghĩ tới, vậy mà cùng Thần Linh Hoàng, Thần Tinh Hoàng đám người thông đồng cùng một chỗ."),t("br"),t("br"),n._v("“Tám đại vương giả thêm vào hai đại Hoàng giả, tương đương với mười đại Cổ Thánh... Bệ hạ không cần thiết hành động thiếu suy nghĩ, nếu không, thực sự quá mức nguy hiểm...”"),t("br"),t("br"),n._v("Lưu Dương vội nói."),t("br"),t("br"),n._v("Mười đại Cổ Thánh, nếu như là Thần Dung Hoàng thời kỳ toàn thịnh, có lẽ không dám thế nào, mà bây giờ... Thật muốn xông tới, chết nhất định là người sau."),t("br"),t("br"),n._v("“Ta biết!” Ngột Thần mày nhíu lại thành cục."),t("br"),t("br"),n._v("Lần này trở về là muốn báo thù, nhưng đối phương tụ tập nhiều như vậy Cổ Thánh, lấy hắn tình huống hiện tại, xông tới, tuyệt đối là dê vào miệng cọp, hẳn phải chết không nghi ngờ."),t("br"),t("br"),n._v("“Ta muốn đi một chuyến Nguyên Đãng sơn!”"),t("br"),t("br"),n._v("Trầm mặc phút chốc, Ngột Thần nói."),t("br"),t("br"),n._v("“Nguyên Đãng sơn?” Lưu Dương nghi ngờ."),t("br"),t("br"),n._v("Đều đi tới nơi này, không nghĩ biện pháp đoạt quyền, vì sao muốn đi loại địa phương này?"),t("br"),t("br"),n._v("Nguyên Đãng sơn là Dị Linh tộc một chỗ hiểm địa, coi như Thần Dung Hoàng thời kỳ toàn thịnh, đều không muốn tiến vào bên trong, giờ phút này lại muốn đi qua, để cho người ta không hiểu."),t("br"),t("br"),n._v("“Đúng, Nguyên Đãng sơn là hiểm địa không giả, có điều, nhưng cũng là Bặc Huân Cổ Thánh tu luyện vị trí, hiện tại, chỉ có thể nhìn một chút, hắn có thể hay không ra tay giúp ta... Thực lực của hắn, so ta toàn thịnh kỳ, đều không kém bao nhiêu, xuất thủ, mới có hy vọng chiến thắng!”"),t("br"),t("br"),n._v("Dừng lại một chút, Ngột Thần nói."),t("br"),t("br"),n._v("Lấy thực lực của hắn bây giờ, khẳng định không có cách nào vượt qua mười đại Cổ Thánh, chỉ có thể nghĩ biện pháp tìm kiếm giúp đỡ."),t("br"),t("br"),n._v("“Bặc Huân Cổ Thánh? Vị này Cổ Thánh ta nghe nói qua, không phải nói ba ngàn năm trước liền chết đi ư?”"),t("br"),t("br"),n._v("Lưu Dương chấn động."),t("br"),t("br"),n._v("“Hắn cũng không vẫn lạc, mà là đi vào Nguyên Đãng sơn chỗ sâu, một mực không có đi ra thôi! Lúc trước thực lực, liền cùng ta tương đương, hiện tại cụ thể mạnh bao nhiêu, ai cũng không rõ ràng... Có lẽ, đã vượt qua tích huyết trùng sinh!”"),t("br"),t("br"),n._v("Ngột Thần gật gật đầu."),t("br"),t("br"),n._v("“Đã hắn không nguyện ý đi ra, để hắn ra tay giúp đỡ... Hẳn là rất khó đi!”"),t("br"),t("br"),n._v("Đối phương đều nấp đi ba ngàn năm, mặc kệ thực lực như thế nào, đều thuyết minh, không nguyện ý tại chạm phải thế sự, ngươi thời kỳ toàn thịnh, cũng chưa chắc xin đi ra, hiện tại, chỉ sợ càng khó."),t("br"),t("br"),n._v("“Khó, cũng muốn mời đi ra, nếu không... Chúng ta hẳn phải chết không nghi ngờ, ngay cả ngươi, cũng không giữ được!”"),t("br"),t("br"),n._v("Ngột Thần lắc đầu."),t("br"),t("br"),n._v("Hắn thật muốn tử vong, toàn bộ Thần Dung Hoàng nhất mạch tất cả tộc nhân, đều sẽ gặp phải tàn sát, điểm ấy không thể nghi ngờ, vì lẽ đó, đã chịu không được do dự."),t("br"),t("br"),n._v("“Ngột Thần nói không sai, Nguyên Đãng sơn ở nơi nào? Lại muốn dùng phương pháp gì, mới có thể đem hắn mời đi ra?”"),t("br"),t("br"),n._v("Trương Huyền mở miệng."),t("br"),t("br"),n._v("Muốn nhân tộc trường trì cửu an, thuận lợi tìm tới Lạc Nhược Hi, Thần Linh Hoàng, Thần Tinh Hoàng hai vị nhất định phải chết, đã đi theo đối phương sau lưng đi tới nơi này, đã nói lên, đã không còn đường lui."),t("br"),t("br"),n._v("“Nguyên Đãng sơn ở cách nơi này thập vạn cây số địa phương, khoảng cách không xa, rất nhanh liền biết đánh nhau cái qua lại, chỉ bất quá, vị này Bặc Huân Cổ Thánh, tính cách cổ quái, chỉ sợ không quá dễ dàng thuyết phục!”"),t("br"),t("br"),n._v("Xoa xoa mi tâm, Ngột Thần nói."),t("br"),t("br"),n._v("PS: Tiếp tục cầu nguyệt phiếu!"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1803"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1805"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);